sys_variable_value.value:
(function execute(inputs, outputs) {
    var gcc = new GoogleCloudComputeUtils();
    inputs = gcc.validateInputVariables(inputs, outputs);
    gcc.validateMandatoryVariables(inputs, ['project', 'zone', 'name']);
    outputs = gcc.maptoOutputFromInput(inputs, outputs, []);
})(inputs, outputs);

